import React from 'react';
import Login from './components/Login';
import Register from './components/Register';
import Chat from './components/Chat'; // Import Chat component

function App() {
  return (
    <div>
      <Register />
      <Login />
      <Chat /> {/* Use Chat component here */}
    </div>
  );
}

export default App;
